export const ImageSign = () => {
  return (
    <div className="w-full bg-amaranth-100 p-8 flex justify-center items-center">
      <img
        src="img/sign-in.png"
        className="h-40 sm:h-72 block m-auto object-contain"
        alt="sign in illustration"
      />
    </div>
  );
};
